(1, '2023-11-23 10:06:53', '2023-11-23 10:15:39', 1, 'Токаев предложил генсекретарям советов безопасности собраться в Астане', 'Касым-Жомарт Токаев на 10-м саммите Организации тюркских государств предложил провести в Астане третью встречу генеральных секретарей советов безопасности, сообщает Zakon.kz. \nОн отметил, что нарастают вызовы, связанные с торговлей оружием и наркотиками, терроризмом, экстремизмом, миграцией. Для предотвращения подобных угроз необходимо укрепить сотрудничество в области безопасности.\nВ этой связи Касым-Жомарт Токаев предложил в следующем году провести в Астане третью встречу генеральных секретарей советов безопасности.\nПо его словам, важно заключить соглашение о совместной борьбе с преступностью и обмене информацией между органами финансовых расследований тюркских государств. \nРанее президент отметил, что в целях содействия тюркскому единству председательство РК будет проходить под девизом \"Тюркская эпоха!\", или \"TURKTIME!\". \nДанные взяты на сайте zakon.kz и носят демонстрационный характер', '2023-11-03 16:06:00', 'data:image/jpeg;base64,', 2, 0);
